import React from 'react';

const Search = () => {
  return (
      <>
    <h1>Hello, I am Search Page</h1>
    <br/>
    <div className='search'>
    <input type="search" placeholder='Enter Image Name'/>
    </div>
    </>
  )
}

export default Search;
